import React from "react";
import { GlobalData } from "../../a";

const Navbar = () => {
  return (
    <nav className="flex items-center justify-between px-6 py-4 bg-white shadow-md">
      {/* Logo */}
      <div className="flex items-center">
        <img src={GlobalData.Logos.ComapnyLogo} alt="Logo" className="h-10" />
      </div>

      {/* Center Menu Items */}
      <ul className="flex space-x-6 text-gray-700 font-medium">
        <li className="cursor-pointer hover:text-blue-500">Features</li>
        <li className="cursor-pointer hover:text-blue-500">Pricing</li>
        <li className="cursor-pointer hover:text-blue-500">How to use</li>
        <li className="cursor-pointer hover:text-blue-500">Roadmap</li>
      </ul>

      {/* Sign In Button */}
      <button className="px-4 py-2 bg-blue-500 text-white rounded-lg hover:bg-blue-600">
        Sign In
      </button>
    </nav>
  );
};

export default Navbar;
